import { Button, TextField } from '@mui/material'
import React from 'react'
import { Link } from 'react-router-dom'
import Precedent from '../components/Precedent'

function Login() {

  const submitHandler = ()=>{
    alert('Hello S');
  }

  return (
    <div className='parentLogin'>
      <Precedent />
      <form onSubmit={submitHandler} className='btn__Code'>
        <TextField className='form__input' label='Code' variant='filled'></TextField>
        <Link to='/Rendezvous' style={{textDecoration:"none", alignSelf:"center"}}><Button variant='contained' color='primary'>Submit</Button></Link>
      </form>
    </div>
  )
}
// http://localhost/brief6/Backend/user/login

export default Login
